import React from 'react';
import { withRouter } from 'next/router';
import { connect } from 'react-redux';
import { Dropdown, Menu, Segment, Grid, Container } from 'semantic-ui-react';

class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            totalData: []
        }
    }

    componentDidMount() {
        console.log("header");
        const options = [];
        Axios.get('https://restcountries.eu/rest/v2/all').then(({ data }) => {
            this.setState({
                totalData: data
            });
            totalData.forEach((country, i) => {
                options.push(
                    {
                        key: i, text: country.name, value: country.currencies[0].code
                    }
                )
            })

    })          
    }
    render() {
        console.log("home")
        return (
            <>
            <Dropdown placeholder="select" options={options} selection clearable />
            </>
        );
    }
}
const options = [
    { key: 1, text: 'Feet', value: 1 },
    { key: 2, text: 'Meter', value: 2 },
    { key: 3, text: 'Inch', value: 3 },
  ]
  const mapDispatchToProps = {};
  export default withRouter(Home);
